  true,\n\t\"url\": null,\n\t\"notes\": \"Bloomington City Council district boundaries
  exported from the CIty's GIS. See summary description (txt) file for information
  about intended use, projection, currency, attributes, etc.rnrnThis map layer represents
  the City Council Districts for the City of Bloomington, Indiana. Bloomington contains
  six representative council districts, numbered one (1) through six (6). Boundaries
  are set by City ordinance. Districts are based on voting precincts and the municipal
  boundary. Any additional area annexed by the city are placed in council districts
  defined by the annexation ordinance. District boundaries may be altered by council
  action but done rarely other than the redistricting process that follows the Decennial
  US Census.  rnFor existing static maps in pdf format See the [City Council GIS Maps](https://bloomington.in.gov/data/dataset/city-council-district-maps/
